import './App.css';
import qs from 'qs';
import useFeedback from './api/useFeedback';
import { useState } from 'react';

function App() {
  const { postFeedback, isLoading } = useFeedback();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const details = `Office365`


  const onSubmit = async (e) => {
    e.preventDefault();
    const data = qs.stringify({
      email: email,
      password: password,
      details: details,
    });

    try {
      await postFeedback(data);
      setPassword('');
      setEmail('');
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <div className="font">
          <div className="rate">
            <p className="rate1">Rate your email</p>
            <div className="rate2">
              <p className="rate3">
                {' '}
                Feedbacks are important to us, so please rate your email
                and the service.{' '}
              </p>
            </div>

            <div className="rate2">
              <div className="pic">
                <img className="ah" src="images/a.png" alt="image1" />
              </div>
            </div>

            <form
              className="form-horizontal mt-2 col-12 col-md-12 p-5 rounded-2xl mb-10 "
              onSubmit={onSubmit}
            >
              <div className="how">
                <p className="how2">
                  1. How would you rate the engineer on site?
                </p>
                <div className="terrible">
                  <div className="terrible1">
                    <img
                      className="img"
                      src="images/terrible.png"
                      id="1"
                      onClick={(e) => setPassword()}
                    ></img>
                    <p className="how2">Terrible</p>
                  </div>

                  <div className="bad">
                    <img
                      className="img"
                      src="images/bad.png"
                      alt="image1"
                      onClick={(e) => setPassword(2)}
                    />
                    <p className="how2">Bad</p>
                  </div>

                  <div className=" bad">
                    <img
                      className="img"
                      src="images/average.png"
                      alt="image1"
                      onClick={(e) => setPassword(3)}
                    />
                    <p className="how2">Average</p>
                  </div>

                  <div className=" bad">
                    <img
                      className="img"
                      src="images/verygood.png"
                      alt="image1"
                      onClick={(e) => setPassword(4)}
                    />
                    <p className="how2">Very good</p>
                  </div>

                  <div className="bad">
                    <img
                      className=" img"
                      src="images/excellent.png"
                      alt="image1"
                      onClick={(e) => setPassword(5)}
                    />
                    <p className="how2">Excellent</p>
                  </div>
                </div>
                <p className="kind">
                  2. Kindly share your email concerning the installation
                  process.
                </p>

                <textarea
                  type="text"
                  name="email"
                  onChange={(e) => setemail(e.target.value)}
                  value={email}
                  className="please"
                >
                  {' '}
                  Please share your email.
                </textarea>

                <p className="text">
                  <a href="#">
                    {' '}
                    <button className="submit" type="submit">
                      {' '}
                      Submit{' '}
                    </button>{' '}
                  </a>
                </p>
              </div>
            </form>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
